import React,{ useState} from 'react';
import { routes } from './utils/routes';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Navbar = () => {

  const [buttonColor, setButtonColor] = useState('initialColor');

  const changeColor = () => {
    if (buttonColor === 'initialColor') {
      setButtonColor('light');
    } else {
      setButtonColor('dark');
    }
  }
  return (
    <div>
      <nav class="navbar navbar-expand-lg bg-body-tertiary">
  <div class="container-fluid">
    <Link to={routes.home}>Home</Link>
    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
        <li className="nav-item">
          
        </li>
        <li className="nav-item">
          <Link to={routes.contact}  >Contact</Link>
        </li>
        <li className="nav-item">
          <Link to={routes.about}  >Favs</Link>
        </li>
        <li className="nav-item">
          <Link to={routes.detail}  >Detail</Link>
        </li>
      </ul>
      <button onClick={changeColor} style={{ backgroundColor: buttonColor }}>Cambiar de color</button>
    </div>
  </div>
</nav>

      
      
      
      
    </div>
  )
}

export default Navbar
